import React from 'react';
import { Link } from 'react-scroll';

const Navbar = () => {
  return (
    <nav className="flex justify-between items-center px-6 py-4 bg-secondary text-white">
      <h1 className="text-2xl font-serif text-primary">My Portfolio</h1>
      <ul className="flex gap-6 font-sans">
        <li>
          <Link to="home" smooth={true} duration={500} className="cursor-pointer hover:text-accent">Home</Link>
        </li>
        <li>
          <Link to="about" smooth={true} duration={500} className="cursor-pointer hover:text-accent">About</Link>
        </li>
        <li>
          <Link to="projects" smooth={true} duration={500} className="cursor-pointer hover:text-accent">Projects</Link>
        </li>
        <li>
          <Link to="resume" smooth={true} duration={500} className="cursor-pointer hover:text-accent">Resume</Link>
        </li>
        <li>
          <Link to="contact" smooth={true} duration={500} className="cursor-pointer hover:text-accent">Contact</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
